import React from 'react';
import './Person.css';

const person = (props) => {
  return (
    <div className='Person'>
      <p onClick={props.click}>
        Welcome, {props.name}! You have visited {props.visit}
      </p>
      <p>{props.children}</p>
      <input
        type='text'
        onChange={props.changed}
        defaultValue={props.name}
        value={props.name}
      />
    </div>
  );
};

export default person;
